PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
ASK WHERE {
  {
    SELECT ?creature (COUNT(DISTINCT ?offProp) AS ?offCount) (COUNT(DISTINCT ?defProp) AS ?defCount) WHERE {
      ?defProp <http://www.w3.org/2000/01/rdf-schema#subPropertyOf> <http://www.semanticweb.org/annab/ontologies/2022/3/ontology#defValues> .
      ?offProp <http://www.w3.org/2000/01/rdf-schema#subPropertyOf> <http://www.semanticweb.org/annab/ontologies/2022/3/ontology#offValues> .

      OPTIONAL {
        ?creature ?defProp ?defVal .
      }
      OPTIONAL {
        ?creature ?offProp ?offVal .
      }
      FILTER(BOUND(?defVal) || BOUND(?offVal))
    }
    GROUP BY ?creature
  }
  FILTER(?offCount > ?defCount)
}

