PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT DISTINCT ?creature ?dexterity WHERE {
  # Creatures speaking Aboleth language with their dexterity
  ?creature <http://www.semanticweb.org/annab/ontologies/2022/3/ontology#hasLanguages> <http://www.semanticweb.org/annab/ontologies/2022/3/ontology#AbolethL> .
  ?creature <http://www.semanticweb.org/annab/ontologies/2022/3/ontology#dex> ?dexterity .

  # Calculate average dexterity of all creatures
  {
    SELECT (AVG(?allDex) AS ?avgDex) WHERE {
      ?anyCreature <http://www.semanticweb.org/annab/ontologies/2022/3/ontology#dex> ?allDex .
    }
  }

  # Filter creatures with dexterity greater than average
  FILTER(?dexterity > ?avgDex)
}

